import React from "react";
import "./Meaning.css";

export default function Meaning(props) {
  return (
    <div className="meaning">
      <h3>{props.meaning.partOfSpeech}</h3>
      {props.meaning.definition.map(function(definition, index){
        return(
          <div key={index}>
            <p>
              {definition.definiton}
              <br/>
              {definition.example}
            </p>
          </div>
        );
      })}
    </div>
  );
}
